import React, { useState } from 'react'
import './App.css';
import 'bootstrap/dist/css/bootstrap.min.css'
import MovieList from './components/MovieList'

function App() {
  const [movies, setMovies] = useState([{
    "Title": "Electroma",
    "Year": "2006",
    "imdbID": "tt0800022",
    "Type": "movie",
    "Poster": "https://m.media-amazon.com/images/M/MV5BODcyMTE2NTQxN15BMl5BanBnXkFtZTcwMzkyMjY0MQ@@._V1_SX300.jpg"
  },
  {
    "Title": "A Bronx Tale",
    "Year": "1993",
    "imdbID": "tt0106489",
    "Type": "movie",
    "Poster": "https://m.media-amazon.com/images/M/MV5BMTczOTczNjE3Ml5BMl5BanBnXkFtZTgwODEzMzg5MTI@._V1_SX300.jpg"
  }
  ])
  return (
    <div className="App">
      <MovieList movies={movies} />
    </div>
  );
}

export default App;
